export const ACTION_TYPES = {
    AUTHENTICATE: 'AUTHENTICATE',
    SIGNUP: 'SIGNUP',
    LOGOUT: 'LOGOUT',
    GET_SESSION: 'GET_SESSION',
    CHANGE_PAGE: 'CHANGE_PAGE',
    GET_CURRENT_PAGE: 'GET_CURRENT_PAGE',
    DETAILS: 'DETAILS',
    MEMBERS: 'MEMBERS',
    RESOURCES: 'RESOURCES',
    USERPROFILE: 'USERPROFILE'
};

const actions = {
    authenticate: payload => ({
        type: ACTION_TYPES.AUTHENTICATE,
        payload
    }),
    signup: payload => ({
        type: ACTION_TYPES.SIGNUP,
        payload
    }),
    logout: payload => ({
        type: ACTION_TYPES.LOGOUT,
        payload
    }),
    getSession: payload => ({
        type: ACTION_TYPES.GET_SESSION,
        payload
    }),
    changeTab: payload => ({
        type: ACTION_TYPES.CHANGE_PAGE,
        payload
    }),
    getActivePage: payload => ({
        type: ACTION_TYPES.GET_CURRENT_PAGE,
        payload
    }),
    details: payload => ({
        type: ACTION_TYPES.DETAILS,
        payload
    }),
    members: payload => ({
        type: ACTION_TYPES.MEMBERS,
        payload
    }),
    resources: payload => ({
        type: ACTION_TYPES.RESOURCES,
        payload
    }),
    userprofile: payload => ({
        type: ACTION_TYPES.USERPROFILE,
        payload
    })
};

export default actions;
